import "./"
const BarraNavegacion = () => {
    return(
        <nav className="header-nav">
            <ul>
                <li>Uno</li>
                <li>Dos</li>
                <li>Tres</li>
                <li>Cuatro</li>
            </ul>
        </nav>
    )
}

export default BarraNavegacion;
